  false,\n\t\"url\": null,\n\t\"notes\": \"This progress report for the Native Prairie
  Adaptive Management Database Archive and Competing Model Linkage project covers
  activities during FY2014. The overall goal of this Project funded by the Natural
  Resource Program Center was to improve the speed of data entry, roll-up and processing
  into the Native Prairie Adaptive Management (NPAM) Cooperator and Coordinator databases
  housed on the DOI SharePoint Portal. Project goals, expected conservation outcomes,
  measurable objectives, and the project status are outlined in this report.\",\n\t\"license_title\":
